import './App.css';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from './pages/Home/Home';
import Register from './pages/Register/Register';
import Navigation from './components/shared/Navigation/Navigation';


function App() {
  return (
    <BrowserRouter>
    <Navigation />
    <Switch>
      <Route path="/" exact>
        <Home />
      </Route>
      <Route path="/register" >
        <Register />
      </Route>
      <Route path="/login" >
        <Login />
      </Route>
    </Switch>
    </BrowserRouter>
  );
}
export default App;
